import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "components/login";
import Home from "components/home";

const Way = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/">
            <Route element={<Login />} path="/login" />
            <Route index element={<Home />}/>
          </Route>
        </Routes>
      </BrowserRouter>
    </>
  );
};
export default Way;
